// src/App.js
import React from "react";
import "./index.css";

function App() {
  return (
    <div className="min-h-screen grid place-items-center">
      <div className="text-center">
        <h1 className="text-3xl font-bold text-indigo-600">BuddyUp</h1>
        <p className="text-zinc-600 mt-2">Tailwind test: this should be indigo</p>
      </div>
    </div>
  );
}

export default App; // <-- only one default export
